import React from "react";
import '../styles/app.css';
import LandingPage from "./LandingPage";
import styled from "styled-components";
import {BrowserRouter,Switch,Route} from "react-router-dom"
import Login from "./Login.js";

function App() {
  return (
    <BrowserRouter>
      <Dashboard>
        <AiFillHome />
        <AiOutlineUser />
        <FaCog />
      </Dashboard>
      <Switch>
        <Route path="/" exact>
          <div className="App">
            <LandingPage />
          </div>
        </Route>
        <Route path="/home">
          <Home />
        </Route>
        <Route path="/auth">
          <Login />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;


const Dashboard = styled.nav`
  min-height: 100vh;
  width: 5vw;
  background-color: #fff;

  display: flex;
  flex-direction: column;
  align-items: center;

  svg {
    margin: 1rem;
    cursor: pointer;
  }
`;
